import React from "react";
import {Menu, Container} from "semantic-ui-react";
import {Link} from "rac"


function Navbar(){

    return (
        <Menu inverted>
            <Container>
                <Menu.Item name="star wars API" />
                <Menu.Item name="people" />
                <Menu.Item name="planets" />
            </Container>
        </Menu>
    )
}
export default Navbar;
